






--テーブル削除処理
DROP TABLE inquiries;

DROP TABLE review_goods;

DROP TABLE thread_goods;

DROP TABLE review_images;

DROP TABLE notices;

DROP TABLE replies;

DROP TABLE reviews;

DROP TABLE thread_hashtag;

DROP TABLE hashtags;

DROP TABLE threads;

DROP TABLE community_user;

DROP TABLE communities;

DROP TABLE users;

CREATE TABLE users(
id SERIAL PRIMARY KEY,
login_id VARCHAR(50) NOT NULL UNIQUE,
name VARCHAR(50) NOT NULL,
password VARCHAR(50) NOT NULL,
image_path text
);
--DROP TABLE users;

--コミュニティテーブル
CREATE TABLE communities(
id SERIAL PRIMARY KEY,
name VARCHAR(50) NOT NULL,
url VARCHAR(255) NOT NULL,
delete_date DATE
);
--DROP TABLE communities;


CREATE TABLE community_user(
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
community_id INT NOT NULL REFERENCES communities(id),
nick_name VARCHAR(50),
role INT NOT NULL,
flag BOOLEAN NOT NULL
);

--DROP TABLE community_user;

--スレッドテーブル
CREATE TABLE threads (
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
community_id INT NOT NULL REFERENCES communities(id),
image_path text,
title VARCHAR(50) NOT NULL,
address VARCHAR(255),
sales_time VARCHAR(25),
genre VARCHAR(25),
create_date TIMESTAMP NOT NULL
);
--DROP TABLE threads;

--ハッシュタグテーブル
CREATE TABLE hashtags (
id SERIAL PRIMARY KEY,
tag_name VARCHAR(50) NOT NULL
);
--DROP TABLE hashtags;

--スレッドハッシュタグテーブル
CREATE TABLE thread_hashtag (
id SERIAL PRIMARY KEY,
thread_id INT NOT NULL REFERENCES threads(id),
hashtag_id INT NOT NULL REFERENCES hashtags(id)
);
--DROP TABLE thread_hashtag;

--レビュー
CREATE TABLE reviews (
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
thread_id INT NOT NULL REFERENCES threads(id),
title VARCHAR(50),
review TEXT,
create_date TIMESTAMP NOT NULL
);
--DROP TABLE reviews;

CREATE TABLE replies(
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
review_id INT NOT NULL REFERENCES reviews(id),
reply TEXT NOT NULL,
create_date TIMESTAMP NOT NULL
);
--DROP TABLE replies;

CREATE TABLE notices(
id SERIAL PRIMARY KEY,
reply_id INT NOT NULL REFERENCES replies(id),
read_flag BOOLEAN NOT NULL
);
--DROP TABLE notices;

CREATE TABLE review_images(
id SERIAL PRIMARY KEY,
review_id INT NOT NULL REFERENCES reviews(id),
image_path text
);
--DROP TABLE review_images;

CREATE TABLE thread_goods(
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
thread_id INT NOT NULL REFERENCES threads(id)
);
--DROP TABLE thread_goods;

CREATE TABLE review_goods(
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
review_id INT NOT NULL REFERENCES reviews(id)
);
--DROP TABLE review_goods;

CREATE TABLE inquiries(
id SERIAL PRIMARY KEY,
user_id INT NOT NULL REFERENCES users(id),
community_id INT NOT NULL REFERENCES communities(id),
content TEXT NOT NULL,
flag BOOLEAN NOT NULL
);
--DROP TABLE inquiries;


