select * 
                        from threads t 
                        left join ( 
                          select thread_id, count(*) good_count 
                          from thread_goods 
                          group by thread_id) g 
                          on t.id = g.thread_id 
                         
                        left join  
                        ( 
                          select thread_id, string_agg(tag_name, ',') AS hashtags 
                          from hashtags h 
                          join thread_hashtag th 
                          on h.id = th.hashtag_id 
                          group by thread_id 
                        ) h 
                        on h.thread_id = t.id 
                        where t.id = 6 ORDER BY t.id;



SELECT u.id AS userId, u.name AS userName,  
                        r.id AS reviewId, r.title, r.review, to_char(r.create_date, 'YYYY-MM-DD HH24:MI') AS createDate  
                        FROM users u JOIN reviews r ON u.id = r.user_id  
                        WHERE r.thread_id = 8 ORDER BY r.id;

----------------------------------



SELECT u.id, 
                        CASE WHEN cu.nick_name IS NULL THEN u.name
                    ELSE cu.nick_name END AS name,
                        cu.role FROM users u JOIN community_user cu
                        On u.id = cu.user_id
                        WHERE cu.community_id = 5 ;

select * from community_user where user_id = 35 and community_id = 5;


