INSERT INTO reviews (user_id,thread_id,title,review,create_date)VALUES
(1,1,'美味しかった!','とてもおいしい料理で満足しました。刺身とかの魚介類が新鮮でした！次は家族を食べ紀行きたいと思います！',now()),
(2,2,'サービス良し','スタッフの対応が素晴らしく、一緒に食事に行ったアメリカ人の友達がチップを渡そうとしていたくらいでしたww僕も含めてとても満足できたので良かったです。',now()),
(3,1,'驚きのボリューム','料理のボリュームが豪華で、満腹感が得られました。友達に教えて貰ったお店だったので期待していたのですが、期待以上のボリュームに驚きが隠せませんでした！ボリュームのわりに値段もお手頃なので是非了解したいと思いました！',now()),
(4,2,'雰囲気が良い','落ち着いた雰囲気でゆっくり過ごせました。久しぶりの外食だったので、落ち着いた雰囲気のお店でよかったです。この外食を楽しみに今月も仕事がんばるゾッ‼',now()),
(5,3,'おしゃれな空間','店内のデザインがおしゃれで、くつろげる空間でした。',now()),
(6,4,'リーズナブルな価格','美味しい料理を手頃な価格で楽しめました。',now()),
(7,3,'スタッフの笑顔','スタッフの笑顔が素晴らしく、心地よい時間を過ごせました。',now()),
(8,4,'期待以上の味','予想以上に料理の味が素晴らしく、感動しました。',now()),
(9,1,'おいしくて感動（泣）','ピザが1人前なのに大きすぎてもうそれだけでおなか一杯になる！そしてチーズが異常に伸びて美味しい＾＾',now());
